"""This functions sends updated id to database."""
def db_send_id(id_number):
    str(id_number)
    try:
        connection = mysql.connector.connect(
            host='192.168.72.41',
            database='zebra',
            user='Python',
            password='python')
        timestamp = datetime.now().strftime('%Y-%m-%d')
        timestamp2 = datetime.now().strftime('%H:%M:%S')
        mycursor = connection.cursor()
        sql = "INSERT INTO transporttu (number, date, time,workplace) VALUES  (%s,%s, %s,%s)"
        val = (id_number, timestamp, timestamp2, socket.gethostname())
        mycursor.execute(sql, val)
        mycursor2 = connection.cursor()
        sql2 = "UPDATE transporttu SET `number`=LPAD(`number`, 12, '0');"
        mycursor.execute(sql2)
        connection.commit()
    except mysql.connector.Error as e:
        print("Error reading data from MySQL table: ", e)
    try:
        if connection.is_connected():
            connection.close()
            cursor.close()
            print("MySQL connection has been closed")
    except:
        print("Connection variable has not been declared")

