"""This functions sends TU ZPL code to printer using socket module."""
def send_tu_to_printer(amount, id_number):
    mysocket = socket.socket(socket.AF_INET,socket.SOCK_STREAM)         
    host = "192.168.73.145" 
    port = 9100   
    label =  (b"""
^XA
^FO15,40^BY3
^BAN,300,Y,N,N
^FO75,30
^FD%s^SFddddddddddddD,1,F^FS
^FO111,341        
^GB50,50,50,W,0^FS

^FO444,341
^GB50,50,50,W,0^FS
^PQ%s
^XZ
    """ % (bytes(id_number, encoding ='utf-8'), bytes(amount, encoding ='utf-8')))

    try:           
        mysocket.connect((host, port)) #connecting to host
        mysocket.send(label)#using bytes
        mysocket.close () #closing connection
    except:
	    print("Error with the connection")

"""This functions fetches latest label id from database."""
def db_fetch_id():
    try:   
        connection = mysql.connector.connect(host='192.168.72.41',
                                                    database='zebra',
                                                    user='Python',
                                                    password='python') 
        print("Connection with database has been established")     
        sql_select_Query = ("SELECT * FROM `transporttu` ORDER BY id DESC LIMIT 1")
        cursor = connection.cursor()
        cursor.execute(sql_select_Query)
        # get all records
        records = cursor.fetchall()
        print("Total number of rows in table: ", cursor.rowcount)
        """Copies data to specific variabales"""
        for row in records:
            id_number = row[1] 

    except mysql.connector.Error as e:
        print("Error reading data from MySQL table: ", e)
        """Closes connection with a database after data has been copied to local variable."""
    try:
        if connection.is_connected():
            connection.close()
            cursor.close()
            print("MySQL connection has been closed")
    except:
        print("Connection variable has not been declared")

    return id_number

