"""This function  handles GUI in tkinter."""
def gui():
    top = tkinter.Tk()
    top.title("Autodoc Premium Label Printer 9000")

    display_message = tkinter.Message(top, text = "Wpisz ilo naklejek do wydruku: ", font = ("Impact", 16), width = 512)
    display_message.pack()

    labels_amount_entry = tkinter.Entry(top, bd =5)
